import React from 'react';
import HomeIcon from '@mui/icons-material/Home';
import FoundationIcon from '@mui/icons-material/Foundation';


export const sidebarData = [
    { 
        title: "Home",
        icon: <HomeIcon />, 
        link: "", 
    }, 
    { 
        title: "Home2", 
        icon: <FoundationIcon />, 
        link: "/home2", 
    }, 
    { 
        title: "Home3", 
        icon: "hello",
        link: "/home3", 
    }, 
    { 
        title: "Account", 
        icon: "hello",
        link: "/account",
    },
];
